import React from 'react';

import './styles.css'

export default function Cadastro(){
    return (
    <div className="container">
        <form className="form">
            
            <input className="nome" placeholder="Informe seu nome completo"></input>
            <input className="email" placeholder="Informe seu e-mail"></input>
            <input className="cpf" placeholder="Informe seu CPF"></input>
            <input className="senha" placeholder="Digite uma senha"></input>
            <button type="submit">Cadastrar</button>
        </form>
        
    </div>
    );
};
